Kotoia kotoi-landarearen haziaren inguruan hazten den zuntz harroa da. Landare hau mundu osoko eskualde tropikal eta subtropikaletan hazten den zuhaixka da, hala nola Amerikan, Pakistanen, Indian eta Afrikan. Zuntzarekin haria egiten da eta ondoren ehun leunak sortzeko erabiltzen da. Gaur egun, arropak egiteko gehien erabiltzen den zuntz naturala da. Izena arabierazko (al) qutn (قُطْن) hitzetik dator eta 1400. urte inguruan hasi zen erabiltzen. Komertzialki hazitako lau kotoi espezie daude: 
* Gossypium hirsutum (munduko ekoizpenaren %90); 
* Gossypium barbadense (munduko ekoizpenaren %8); 
* Gossypium arboreum (munduko ekoizpenaren %2 baino gutxiago); 
* Gossypium herbaceum (munduko ekoizpenaren %2 baino gutxiago). Kotoi barietate hibridoak ere lantzen dira.
